import React from 'react';
import styled from 'styled-components';

const BlogContainer = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const Blog = () => {
  return (
    <BlogContainer>
      <h1>Blog</h1>
      <p>Stay updated with our latest insights and news.</p>
    </BlogContainer>
  );
};

export default Blog;
